import { Card, Button } from 'react-bootstrap';
import ReactCardCarousel from 'react-card-carousel';

export default function FanFavorite () {

    const card = () => {
        return (
            <Card style={{width: '200px'}}>
                <Card.Img />
                <Card.Body>
                    <Card.Title>Card Title</Card.Title>
                    <Card.Text>
                        Movie description or something
                    </Card.Text>
                </Card.Body>
                <Button>Watchlist</Button>
            </Card>
        )
    }
    return (
        <div>
            <h1>Fan favorites</h1>
            <ReactCardCarousel autoplay={ true } autoplay_speed={ 2500 } spread='wide'>
                {card()}
            </ReactCardCarousel>
            <Card style={{width: '200px'}}>
                <Card.Img />
                <Card.Body>
                    <Card.Title>Card Title</Card.Title>
                    <Card.Text>
                        Movie description or something
                    </Card.Text>
                </Card.Body>
                <Button>Watchlist</Button>
            </Card>
        </div>
    )
}
